import {useState,useEffect} from 'react';
const Profile=()=>{
    const [email,setEmail]=useState("");
    useEffect(function(){
        let x=localStorage.getItem("obj");
        x=JSON.parse(x);
        setEmail(x.email);
    },[]);
    return(
        <div>
            {email}
        </div>
    )
}
export default Profile;
